package com.ramon.provider;

import com.ramon.provider.manager.asignatura.AsignaturaManager;
import com.ramon.provider.manager.user.UserManager;
import com.ramon.provider.model.Asignatura;
import com.ramon.provider.model.User;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.context.event.ApplicationReadyEvent;
import org.springframework.context.ApplicationListener;
import org.springframework.stereotype.Component;

@Component
public class ResourcesHandler implements ApplicationListener<ApplicationReadyEvent> {

    @Autowired
    protected UserManager userManager;

    @Autowired
    protected AsignaturaManager asignaturaManager;

    @Override
    public void onApplicationEvent(ApplicationReadyEvent event) {
        initializeUser();
        initializeUser2();
        initializeAsignatura();
    }

    public void initializeUser() {
        User user = new User();
        user.setFirstName("Ramon");
        user.setLastName("Ramos");
        user.setUsername("rramos");
        user.setDescription("Hola");
        user.setPuesto(User.PUESTO.PROFESOR);
        user.setIcon("");
        userManager.importUser(user);
    }

    public void initializeUser2() {
        User user = new User();
        user.setFirstName("Test");
        user.setLastName("Rodriguez");
        user.setUsername("tesst");
        user.setDescription("No hola");
        user.setEmail("hola@gmail.com");
        user.setPuesto(User.PUESTO.ESTUDIANTE);
        user.setIcon("");
        userManager.importUser(user);
    }

    public void initializeAsignatura() {
        Asignatura asignatura = new Asignatura();
        asignatura.setId("mates");
        asignatura.setName("mates");
        asignaturaManager.importAsignatura(asignatura);
    }
}
